class App extends React.Component {
    render(){
        return (
            <Router>
            <div className="container">
              <Navigation />
                <Route path="/" exact component={Home}/>
                <Route path="/about" component={Profile}/>
                <Route path="/contact" component={Login}/>
                <Route path="/locations" component={Signup}/>
            </div>
            </Router>
        )
    }
}
export default App;
